  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-profile-data-from-xbts-collected-aboard-multiple-platforms-in-the-atlantic-ocean-as89c32\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature data were collected from 32,300
  XBT casts in the Labrador Sea, Davis Strait, and the North Atlantic and South Atlantic
  Ocean from March 2011 to December 2011. Data were collected and submitted by the
  NOAA Atlantic Oceanographic and Meteorological Laboratory as part of the High Resolution
  XBT Network for lines AX7, AX2, AX7, AX8, AX10, AX20, and AX97. These data were
  also collected in support of the Ship of Opportunity (SOOP) and the Global Temperature
